import React from 'react'
import Document, { Head, Main, NextScript } from 'next/document'
import { ServerStyleSheet } from 'styled-components'
import Helmet from 'react-helmet'

export default class MyDocument extends Document {
  static async getInitialProps(ctx) {
    const { renderPage, pathname } = ctx
    const sheet = new ServerStyleSheet()
    try {
      const page = renderPage((App) => (props) => sheet.collectStyles(<App {...props} />))
      const initialProps = await Document.getInitialProps(ctx)
      return {
        ...page,
        pathname,
        styles: (
          <>
            {initialProps.styles}
            {sheet.getStyleElement()}
          </>
        ),
        helmet: Helmet.renderStatic(),
      }
    } finally {
      sheet.seal()
    }
  }

  render() {
    const {
      pathname,
      helmet: { htmlAttributes, bodyAttributes, ...helmet },
    } = this.props
    const htmlAttrs = htmlAttributes.toComponent()
    const bodyAttrs = bodyAttributes.toComponent()
    const headComponent = <>{Object.values(helmet).map((el) => el.toComponent())}</>

    return (
      <html lang="th" {...htmlAttrs}>
        <Head>
          {headComponent}
          {pathname !== '/noscript' && (
            <noscript>
              <meta httpEquiv="refresh" content="0; URL=/noscript" />
            </noscript>
          )}
        </Head>
        <body {...bodyAttrs}>
          <Main />
          <NextScript />
        </body>
      </html>
    )
  }
}
